import React, { useState, useEffect } from 'react';
import '../data.css';

var check = true

function Data() {

    const [isData, setData] = useState([])
    const [isConfiguredData, setConfiguredData] = useState({
        headerNBA: [],
    })

    useEffect(() => {
        fetch('/api').then(
            res => res.json()
        ).then(data => configureData(data))
    }, [])

    function configureData(data) {
        setData(data)
    }

    function setHeader(header) {
        var tempHeader = []
        var count = 0
        let index = 126
        var sHeader = String(header)
        let temp = ""
        console.log("SET HEADER", sHeader)
        console.log("SET HEADER", sHeader[140])
        check = true

        for (let x = 0; x < 10; x++) {
            count = 0
            while (check) {
                console.log("run")
                if (sHeader[index] == '`') {
                    check = false
                    console.log("BREAK")
                }
                if (count > 500) {
                    check = false
                }
                else {
                    temp += sHeader[index]
                    index++
                    count++
                }
            }
            index++
            let temp2 = temp.replace(/undefined/g, "")
            let temp3 = temp2.replace("`", "")
            tempHeader.push(temp3)
        }
        console.log("TEMP HEADER", tempHeader)
    }

    return (
        <div className="App">
            HI
            {setHeader(isData.headerNBA)}
        </div>
    );
}

export default Data;
